import './App.css';
import Header from './screens/templates/header'
import LastPropertyForSales from './screens/components/lastPropertyForSales'

import React, { useEffect, useState } from 'react';

function App() {

  const properties = useState(0)

  useEffect(() => {
    fetch("localhost:8000/api/v1/properties")
    .then(res => res.json())
    .then((data) => {
      this.setState({ properties: data })
    })
    .catch(console.log)
  }, [])

  return (
    <div className="App">
        <Header />
        <LastPropertyForSales />
    </div>
  );

}

export default App;
